import React from 'react'
import {Label, Pie, PieChart, Tooltip,Title } from 'recharts'


function Genderchart() {
   
  {
  
    const data = {
      labels: [
        'Red',
        'Blue',
        'Yellow'
      ],
      datasets: [{
        label: 'My First Dataset',
        data: [10, 5, 10],
        backgroundColor: [
          'rgb(255, 99, 132)',
          'rgb(54, 162, 235)',
          'rgb(255, 205, 86)'
        ],
        hoverOffset: 4
      }]
    };
     return(
      
 <PieChart/>
      
    )
   
  }
}


export default Genderchart
